const EventList = (props) => {
    return(
        <div className="card">
            <div className="row no-gutters">
                <div className="col-md-3">
                <img src={`/images/${props.img}`} className="card-img" alt="..." />
                </div>
                <div className="col-md-9 mt-2">
                    <div className="card-body">
                            <a><h5 className="card-title logo">{props.title}</h5></a>
                            <h5 className="card-subtitle mt-2 mb-4">{props.start_date} - {props.end_date}</h5>
                        <p className="card-text mb-2">{props.text}</p>
                        
                    </div>
                </div>
            </div>
            <style jsx>{`
            .card-text{
                font-size: 1.3em;
            }
        .card{
            margin: 1em;
            background-color: #1e2227;
            border: none;
            color: #fff;
            border-bottom: 2px solid #fff;
            border-radius: 0;
            padding: 1em 0em 1em 0em;
            margin-bottom: 2em;
        }
        a:hover{
            text-decoration: none;
        }
        .logo{
            font-size: 2rem !important;
            font-family: 'Abril Fatface' !important;
            color: #fff;
            text-decoration: none;
        }
        .card-body{
            padding: 0;
            padding-left: 2em;
        }
        
        @media only screen and (max-width: 450px){
            .card-body{
                padding-left: 0em !important;
            }
        }
      `}</style>
        </div>
    )
}

export default EventList;
